import React from 'react'
import  ReactDOM  from 'react-dom'
import { BrowserRouter as Router, Routes, Route, Switch, Link}
    from 'react-router-dom';

function App(){
  return(
    <div>
      <Router>
        <Switch>
          <Link to="/test"></Link>
        </Switch>
        <Route path="/test">
          <h1>Hello</h1>
        </Route>
      </Router>
    </div>
  )
}
